      }
      string CountryDescription = "";
      bool available_Country = UDMethods.GetCountryDescription(Context.CompanyID,OTSCountry, out CountryDescription);
      if (available_Country) {
        CustCountry = CountryDescription;
      }
    }

    Inputs.var_orderdtl.Value = "Mode: " + Mode + "  |  Order/Quote No: " + OrderNum.ToString() + "   | Cust: " + CustName + "  |   ShipCountry: " + CustCountry;
    Inputs.var_shipcountry.Value = CustCountry;
  }

  /* ********************************************************************************************************************************************************************************** */
  if (Mode == "Test") {

    Inputs.var_orderdtl.Value = "Mode: " + Mode;
    /* Inputs.var_shipcountry.Value = "Albania". */

    Inputs.var_custid.Value = 1;

  }

  /* ********************************************************************************************************************************************************************************** */

  string palletlookup = "";

  palletlookup = "";

  /* Finds Pallet lookup from csv based on Shipping country*/
  palletlookup = PCLookUp.DataLookup("CountryPalletList", "pallet_type",  Inputs.var_shipcountry.Value);

  if (palletlookup != "") {
    Inputs.var_palletlookup.Value = palletlookup + "_Lookup";
    Inputs.var_packcomment.Value = PCLookUp.DataLookup("CountryPalletList", "default_message",  Inputs.var_shipcountry.Value);
  }

if (palletlookup == "") {Inputs.var_palletlookup.Value = "All_Lookup";}
}


/* ********************************************************************************************************************************************************************************** */

/* Verifies if the customer has unique customer part numbers and checks that a number has been returned based on the configuration */

string custpartverification = "";

custpartverification="";

custpartverification = PCLookUp.DataLookup("Customer_PartNumber_Verification", "Part_Verification_On",  CustName);


if ((custpartverification == "True") && ( Inputs.var_qmfgnum.Value == "")) {

	MessageBox.Show("The Configurator has been unable to determine the Customer specific finished goods number for the chosen configuration. Verification is currently set as mandatory for this customer. Please verify the chosen options and correct if required. If the options chosen are correct please notify the Operations department who will add a specific customer reference for the chosen configuration.", "Note", MessageBoxButtons.OK,  MessageBoxIcon.Information);
	PageLeaveFunctions.SetNextInputPage(1);
	Args.Cancel = true;

}

