/* Determine the wallm operation cycle time based on FG Number */


/* Find Wallm cycle_time_selector */
string wallmcycletimelookup = "";
wallmcycletimelookup = "";
wallmcycletimelookup = PCLookUp.DataLookup("WallmountTypes", "cycle_time_selector", Inputs.cmb_walltype.Value);

/* Returns cycletime from Master FG List CSV */

string wallmcycletimeselector = "";

wallmcycletimeselector = wallmcycletimelookup + "_op_time_min";

Inputs.var_op20time.Value = UDMethods.ConvertToDecimal(PCLookUp.DataLookup("TENUK_FG_MasterTable", wallmcycletimeselector, Inputs.var_fgnum.Value));

