if (Inputs.var_custid.Value == 3814) {
  string flagident3814 = "";
  string custpartnum3814 = "";
  string custintpart3814 = "";
  string custdesc3814 = "";
  custpartnum3814="";
  custintpart3814="";
  custdesc3814="";

  flagident3814 = Inputs.var_smart2.Value;

  custpartnum3814 = PCLookUp.DataLookup("Amazon_CustomerPartRefs", "cust_part", flagident3814);
  custintpart3814 = PCLookUp.DataLookup("Amazon_CustomerPartRefs", "cust_int_part", flagident3814);
  custdesc3814 = PCLookUp.DataLookup("Amazon_CustomerPartRefs", "cust_desc", flagident3814);

  if (custpartnum3814 != "") {
    Inputs.var_qmfgnum.Value = custpartnum3814;
    Inputs.var_fgdesc.Value = custdesc3814;
    Inputs.var_fgnum.Value = custintpart3814;
  }

  if ((Inputs.var_qmfgnum.Value =="") && ( Inputs.chk_erroron.Value == true )) {

		MessageBox.Show("The configurator has been unable to determine the customer part cross reference for this specific configuration, which has been defined as a mandatory requirement for this account. Please discuss this issue with your Epicor system administrator.", "Error", MessageBoxButtons.OK,  MessageBoxIcon.Exclamation);
		PageLeaveFunctions.SetNextInputPage(1);
		Args.Cancel = true;
  }

